// define a function that takes an array as input and returns an integer
function f_gold(arr) {
    // initialize an empty object to store the count of each element in the array
    var counter = {};
    // initialize a variable to store the answer, set to -1 by default
    var ans = -1;
    // loop through the array and update the count of each element in the counter object
    for (var i = 0; i < arr.length; i++) {
        if (counter[arr[i]] == undefined) {
            counter[arr[i]] = 1;
        }
        else {
            counter[arr[i]] += 1;
        }
    }
    // loop through the counter object and find the first key-value pair where the key equals the value
    // and the key is greater than the current answer
    for (var num in counter) {
        if (parseInt(num) == counter[num] && ans < parseInt(num)) {
            ans = parseInt(num);
        }
    }
    // return the answer
    return ans;
}
